class Solution {
    func splitWordsBySeparator(_ words: [String], _ separator: Character) -> [String] {
        // Initialize an empty array to hold the split words.
        var splitWords = [String]()

        // Iterate over each word in the input array.
        for word in words {
            // Split the current word by the separator, excluding empty subsequences to ignore empty strings.
            let splits = word.split(separator: separator, omittingEmptySubsequences: true)

            // Append each split part to the splitWords array.
            for split in splits {
                splitWords.append(String(split)) // Convert Substring to String before appending.
            }
        }

        // Return the array of split words.
        return splitWords
    }
}
